import React from 'react';

const RecentScores = () => {
    return (
        <div>
            <h1>Recent Scores</h1>  
            <p>These are my most recent plays.</p>
            <button>Home</button>
            <button>Highest Scores</button>
        <button>Noteworthy Scores</button>
        </div>
    );
};

export default RecentScores;
